function Counter() {
  useEffect(()=>{
    console.log("mounding...");
    return (()=>{
      console.log("Unmounding...");
    }, [])
  })
  const[count,setCount] =useState(0)
  return (
    <div>
      <button onClick={()=>setCount(count+1)}>Increment</button>
      <h1>Hello I am thamburu componenr: {count}</h1>
    </div>
  )
}

export default Counter;
